DROP DATABASE IF EXISTS myMusic;
CREATE DATABASE myMusic;
USE myMusic;
CREATE TABLE `songs`(
    `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `youtube_link` VARCHAR(255) NULL,
    `album_id` INT NOT NULL,
    `artist_id` INT NOT NULL,
    `title` VARCHAR(255) NOT NULL,
    `length` TIME NOT NULL,
    `track_number` INT NOT NULL,
    `lyrics` VARCHAR(255),
    `created_at` DATE NOT NULL,
    `uploaded_at` DATE NOT NULL
);
CREATE TABLE `albums`(
    `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `artist_id` INT NOT NULL,
    `name` VARCHAR(255) NOT NULL,
    `cover_img` VARCHAR(255) NOT NULL,
    `created_at` DATE NOT NULL,
    `uploaded_at` DATE NOT NULL
);
CREATE TABLE `artists`(
    `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `name` VARCHAR(255) NOT NULL,
    `created_at` DATE NOT NULL,
    `uploaded_at` DATE NOT NULL
);
CREATE TABLE `playlists`(
    `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `name` VARCHAR(255) NOT NULL,
    `cover_img` VARCHAR(255) NOT NULL,
    `created_at` DATE NOT NULL,
    `uploaded_at` DATE NOT NULL
);
CREATE TABLE `songs_in_playlists`(
    `playlist_id` INT NOT NULL,
    `song_id` INT NOT NULL,
    PRIMARY KEY(`playlist_id`, `song_id`)
);
CREATE TABLE `users`(
    `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `name` VARCHAR(255) NOT NULL,
    `email` VARCHAR(255) NOT NULL,
    `created_at` DATE NOT NULL,
    `is_admin` BOOLEAN NOT NULL,
    `preferences` VARCHAR(255) NOT NULL,
    `remember_token` INT NOT NULL
);
CREATE TABLE `song_interactions`(
    `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `song_id` INT NOT NULL,
    `user_id` INT NOT NULL,
    `is_liked` BOOLEAN NOT NULL,
    `play_count` INT NOT NULL
);
ALTER TABLE
    `songs_in_playlists` ADD CONSTRAINT `songs_in_playlist_playlist_id_foreign` FOREIGN KEY(`playlist_id`) REFERENCES `playlists`(`id`) ON DELETE CASCADE;
ALTER TABLE
    `song_interactions` ADD CONSTRAINT `song_interactions_user_id_foreign` FOREIGN KEY(`user_id`) REFERENCES `users`(`id`) ON DELETE CASCADE;
ALTER TABLE
    `songs` ADD CONSTRAINT `song_album_id_foreign` FOREIGN KEY(`album_id`) REFERENCES `albums`(`id`) ON DELETE CASCADE;
ALTER TABLE
    `albums` ADD CONSTRAINT `album_artist_id_foreign` FOREIGN KEY(`artist_id`) REFERENCES `artists`(`id`) ON DELETE CASCADE;
ALTER TABLE
    `songs` ADD CONSTRAINT `song_artist_id_foreign` FOREIGN KEY(`artist_id`) REFERENCES `artists`(`id`) ON DELETE CASCADE;
ALTER TABLE
    `songs_in_playlists` ADD CONSTRAINT `songs_in_playlist_song_id_foreign` FOREIGN KEY(`song_id`) REFERENCES `songs`(`id`) ON DELETE CASCADE;
ALTER TABLE
    `song_interactions` ADD CONSTRAINT `song_interactions_song_id_foreign` FOREIGN KEY(`song_id`) REFERENCES `songs`(`id`) ON DELETE CASCADE;







